import React, {Component} from 'react';
import SignIn from "../components/SignIn";

class Home extends Component {
  render() {
    return (
      <div>
        <h1> Welcome </h1>
        <div className="w-1/5 mt-200px">
        <SignIn />
        </div>
      </div>
    )
  }
}

export default Home;
